import React, { useState, useEffect } from 'react';
import { Chart as ChartJs, CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend } from 'chart.js';
import { Line } from 'react-chartjs-2';
import styled from 'styled-components';
import io from 'socket.io-client';

const socket = io('http://localhost:3000');

ChartJs.register(
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend,
);

function Report() {
    const [data, setData] = useState([]);

    useEffect(() => {
        fetch('http://192.168.1.23:3000/get-data')
            .then(response => response.json())
            .then(data => setData(data))
            .catch(error => console.error('Error fetching data:', error));
    }, []);

    useEffect(() => {
        socket.on('new-data', (newData) => {
            setData((prevData) => [...prevData, newData]);
        });

        return () => {
            socket.off('new-data');
        };
    }, []);

    const formatDate = (dateString) => {
        const options = {
            timeZone: 'Asia/Manila',
            year: 'numeric',
            month: 'long',
            day: 'numeric',
            hour: '2-digit',
            minute: '2-digit',
            second: '2-digit',
        };
        return new Date(dateString).toLocaleString('en-US', options);
    };

    const chartData = {
        labels: data.map(item => formatDate(item.time)),
        datasets: [
            {
                label: 'Temperature',
                data: data.map(item => item.temperature),
                borderColor: 'blue',
                backgroundColor: 'rgba(0, 0, 255, 0.5)',
                tension: 0.2,
                fill: true,
            },
            {
                label: 'Humidity',
                data: data.map(item => item.humidity),
                borderColor: 'green',
                backgroundColor: 'rgba(0, 255, 0, 0.5)',
                tension: 0.2,
                fill: true,
            }
        ]
    };

    const options = {
        responsive: true,
        plugins: {
            legend: {
                position: 'bottom',
                labels: {
                    font: {
                        family: 'Segoe UI',
                        color: '#222260'
                    }
                }
            },
            tooltip: {
                mode: 'index',
                intersect: false,
                bodyFont: {
                    family: 'Segoe UI',
                    color: '#222260'
                },
                titleFont: {
                    family: 'Segoe UI',
                    color: '#222260'
                },
            },
        },
        scales: {
            x: {
                display: true,
                ticks: {
                    font: {
                        family: 'Segoe UI',
                        color: '#222260'
                    }
                }
            },
            y: {
                display: true,
                beginAtZero: true,
                ticks: {
                    font: {
                        family: 'Segoe UI',
                        color: '#222260'
                    }
                }
            }
        }
    };

    return (
        <ReportStyled>
            <div className="header">
                <h2>Analytics</h2>
                <small>Track your temperature and humidity over time.</small>
            </div>
            <Line options={options} data={chartData} />
            <div className="history-con">
                <h2>Temperature and Humidity Data</h2>
                <table>
                    <thead>
                        <tr>
                            <th>Timestamp</th>
                            <th>Temperature (&deg;C)</th>
                            <th>Humidity (%)</th>
                        </tr>
                    </thead>
                    <tbody>
                        {data.map((record, index) => (
                            <tr key={index}>
                                <td>{formatDate(record.time)}</td>
                                <td>{record.temperature}</td>
                                <td>{record.humidity}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </ReportStyled>
    );
}

const ReportStyled = styled.div`
    background: #FFFFFF;
    box-shadow: 0px 1px 15px rgba(0, 0, 0, 0);
    padding: 1rem;
    border-radius: 20px;
    height: 100%;
    font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
    color: #222260; 

    .header {
        display: flex;
        flex-direction: column;
        align-items: center;
        margin-bottom: 1rem;

        h2 {
            margin: 0;
            font-size: 1.5rem;
        }

        small {
            font-size: 1rem;
            margin-bottom: 1rem;
        }
    }

    .history-con {
        background: #ffffff;
        border-radius: 8px;
        box-shadow: 0 4px 8px rgba(0, 0, 0, 0.08);
        padding: 20px;
        width: 100%;
        margin-top: 2rem;

        h2 {
            font-size: 1.5rem;
            margin-bottom: 1rem;
            color: #222260; 
        }

        table {
            width: 100%;
            border-collapse: collapse;
            margin-top: 1rem;

            th, td {
                padding: 12px;
                text-align: left;
                border-bottom: 1px solid #ddd;
                color: #222260; 
            }

            th {
                background-color: #f2f2f2;
                font-weight: bold;
            }

            tr:hover {
                background-color: #f1f1f1;
            }
        }
    }
`;

export default Report;
